import { Component } from '@angular/core';
import { FormBuilder } from '@angular/forms';

@Component({
  selector: 'login-page',
  templateUrl: './login-page.html'
})
export class LoginPageComponent {

  constructor(
    private cartService: CartService,
    private formBuilder: FormBuilder,
  ) { }

}
